To output the values in a dictionary sorted by key alphabetically in JavaScript, you can use the `Object.keys()` method to get an array of the keys in the dictionary, and then sort that array using the `sort()` method. You can then use a loop to iterate over the sorted keys and print out the corresponding values.
```
const myDict = {a: 1, b: 2, c: 3};

// Sort the keys alphabetically
const sortedKeys = Object.keys(myDict).sort();

// Print out the values in order of the sorted keys
for (let key of sortedKeys) {
  console.log(myDict[key]);
}
```
This will output:
```
1
2
3
```
